import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_query.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_query.png'));

    // Wait for autocomplete suggestions to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of autocomplete dropdown
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_autocomplete_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_autocomplete_visible.png'));

    // Extract autocomplete suggestions
    const suggestions = await page.$$eval('.suggestion-item', items => 
      items.map(item => item.textContent.trim())
    );

    // Verify we have suggestions and they contain relevant terms
    const hasRelevantSuggestions = suggestions.some(suggestion => 
      suggestion.toLowerCase().includes('iphone') || 
      suggestion.toLowerCase().includes('electronics')
    );

    return {
      success: true,
      action: "Tested search autocomplete functionality by typing 'iPhone' and verifying suggestions appear",
      extractedData: {
        suggestionsCount: suggestions.length,
        suggestions: suggestions.slice(0, 5), // First 5 suggestions
        hasRelevantSuggestions: hasRelevantSuggestions
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
